import React from "react";

const UserListItem = (props) => {
    const { user } = props;

  return (
    <div className="list-group-item list-group-item-action" >
      <img alt={`${user.username} profile`} src={user.image}/>
      {user.username}
    </div>
  );
};

export default UserListItem;
